%xlabel('Solver iteration', 'FontSize', f_size, 'FontName', f_type); 
%ylabel('Natural merit function', 'FontSize', f_size, 'FontName', f_type);
%print(gcf,'-depsc2','convergence');
%print(gcf,'-dpng','convergence');


